import React from 'react'
import {
    Typography,
    Avatar,
    Grid,
    Box
} from "@material-ui/core"
import avatar from '../jonpic.jpg'

const Header = () => {
    return (
        <Box>
            <Avatar src={avatar} alt="Jonathan Winkles"/>
        </Box>
    )
}

export default Header
